import React, { useState } from 'react';
import PopupWindow from './PopupWindow';

const OpenLinkWebSDK = () => {
  const [linkToken, setLinkToken] = useState(null);
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState(null);

  const fetchLinkToken = async () => {
    setLoading(true);
    setError(null);
    try {
      const response = await fetch('http://localhost:3000/api/linkTokenCall', {
        method: 'POST',
        headers: {
          'Accept': 'application/json',
          'Content-Type': 'application/json',
        },
      });

      if (!response.ok) {
        throw new Error('Network response error');
      }

      const result = await response.json();
      setLinkToken(result.linkToken);
    } catch (error) {
      console.error('Error fetching link token:', error);
      setError(error.message);
    } finally {
      setLoading(false);
    }
  };

  const handleButtonClick = async () => {
    await fetchLinkToken();
    // Optionally handle errors or loading state here
  };

  return (
    <div>
      <button onClick={handleButtonClick} disabled={loading}>
        {loading ? 'Loading...' : 'Fetch Link Token'}
      </button>
      {error && <p>Error: {error}</p>}
      {linkToken && <PopupWindow linkToken={linkToken} />}
    </div>
  );
};

export default OpenLinkWebSDK;
